import React from 'react';
import WorkCard from './WorkCard';


class jobExperience {
    constructor(title, description, company,dateRange, techUsed){
        this.title = title;
        this.description = description;
        this.company = company;
        this.dateRange = dateRange;
        this.techUsed = techUsed;
    }
}

MGCS = new jobExperience("IT Developer (Internship)","Worked as a worker in angular", "Ministry of Ontario Integration Cluster","September 2021 - Decemnber 2021",["Angular","Javascript","Oracle SQL", "HTML", "CSS"]); 

function WorkExperiences() {

    return (
        <div>
        <h2>Work Experiences</h2>
        <WorkCard title={MGCS.title} description={MGCS.description} company={MGCS.company} dateRange={MGCS.dateRange} techUsed={MGCS.techUsed} />
        </div>
    );
}

export default WorkExperiences;
